●LED電球　T形　D形　電球色/昼光色　 全方向タイプ 電球形蛍光ランプEFD15/EFD25代替推奨<br>
<br>

【仕様】<br>
LED電球（T形タイプ ）<br>
口金：E26<br>
消費電力:7W<br>
定格電圧(周波数)：AC100V　（50/60Hz)<br>
色温度：電球色 2700K / 昼光色 6000K<br>
全光束：電球色 850lm / 昼光色 870m（一般電球60W形相当）<br>
配光角：300度（全配光タイプ）<br>
演色性：Ra82以上<br>
サイズ：全長108.4×最大径40（mm）<br>
※日亜化学チップ<br>
カバー：乳白カバー<br>
重量：110ｇ<br>
高品質、省エネ<br>
1年間製品保証<br>
定格寿命40,000時間以上<br><br>

※調光器非対応<br>
※蛍光スイッチ対応<BR><BR>

