約40000時間の長寿命で、ランプ交換の手間が少ないLED小形電球です！<br />
口金サイズがE17口金なので、照明器具を替えることなくご使用いただけます。トイレや廊下などの使用に最適です。<br />
密閉形器具・断熱材施工器にも使用できます*。<br />
（* 密閉形器具・断熱材施工器具の種類によって、寸法が合わない、熱がこもる要因により、使用できなかったり、寿命が短くなる場合があります。）<br />
光色は明るい雰囲気を演出する「昼白色相当」と温かみのある「電球色相当」の2種類です。<br />
<br />
商品情報<br />
●口金サイズ：E17<br />
●光色<br />
　LDA4L-H-E17-V6：電球色相当<br />
●全光束：約230lm<br />
●定格消費電力：3.5W<br />
●定格入力電流：0.06A<br />
●定格寿命：約40000時間<br />
●電源：100V（50/60Hz共用）<br />
●使用場所：屋内用<br />
●ランプ全体の明るさ：小形電球25W形相当<br />
<br />
●商品サイズ（cm）：直径約3.5×高さ約6.7<br />
●パッケージサイズ（cm）：幅約4.1×奥行約4.1×高さ約7.8<br />
●重量：約35g<br />
●材質：アルミ、ポリカーボネート、PBT<br />
<br />
